{"operationName":"products","variables":{"productIds":["50051696","10020766","10007354","10021289","10010769","10022644","10011465","10020119","10005254","10020706","10020830","10002042"]},"query":"query products($productIds: [String]!) {
  products(productIds: $productIds) {
    productId
    name {
      cyrillic
      latin
      __typename
    }
    rating {
      star
      count
      __typename
    }
    media {
      images {
        key
        urls
        __typename
      }
      __typename
    }
    features {
      main {
        name
        value
        __typename
      }
      energyEfficiency {
        name
        value
        __typename
      }
      __typename
    }
    brand {
      name
      __typename
    }
    categories {
      id
      name
      __typename
    }
    __typename
  }
}
